svg.script:
var tabscount=18;
webMI.addOnload(function(e) {
var id = "irtab_1";
var value = true;
webMI.gfx.setMoveX(id, webMI.translate(value, false, true, 0, -5));

for(i=1;i<=tabscount;i++){
	var sirtab = "irtab_"+i;
	if(id !=sirtab)
		webMI.gfx.setMoveX("irtab_"+i, webMI.translate(value, false, true, 0, 0));
}
});


